import SubmitBot from '../submitbot/SubmitBot';
import Leaderboard from '../leaderboard/Leaderboard';

interface gameProps {
  name: string;
  description: string;
}

const Game = ({ name, description }: gameProps) => {


  return (
    <div>
      <h1>{name}</h1>
      <h2>{description}</h2>
      <SubmitBot name="tictactoe" />
      <Leaderboard name="tictactoe" />
    </div>
  );
};

export default Game;
